import React from 'react';

function Schedule() {
  const shuttleSchedule = [
    { day: 'Monday', time: '9:00 AM' },
    { day: 'Tuesday', time: '10:30 AM' },
    { day: 'Wednesday', time: '2:00 PM' },
    // Add more schedule entries here
  ];

  return (
    <div className="content">
      <h2>Shuttle Schedule</h2>
      <table className="schedule-table">
        <thead>
          <tr>
            <th>Day</th>
            <th>Time</th>
          </tr>
        </thead>
        <tbody>
          {shuttleSchedule.map((entry, index) => (
            <tr key={index}>
              <td>{entry.day}</td>
              <td>{entry.time}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default Schedule;
